import React, { Component } from "react";

class Error extends Component {
  componentDidMount() {}
  render() {
    return (
      <div className="error">
        <h1>404 NOT FOUND</h1>
        <h1>{this.props.page}</h1>
      </div>
    );
  }
}

export default Error;
